import light from '../image/light.svg'

function Component(){
    return(
        <main>
            <div>
                <h1>Pongsin Lertchawalit</h1>
                <p>DarkMode React</p>
            </div>
            <img src={light} alt="Logo"/>
        </main>
    )
}
export default Component;
